import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const AdminDashboard = () => {
  const [stats, setStats] = useState({
    totalProducts: 0,
    totalOrders: 0,
    totalUsers: 0,
    recentOrders: []
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      const [productsRes, ordersRes] = await Promise.all([
        axios.get('/api/products'),
        axios.get('/api/orders/admin')
      ]);
      
      setStats({
        totalProducts: productsRes.data.length,
        totalOrders: ordersRes.data.length,
        totalUsers: 0, // Would need a users endpoint
        recentOrders: ordersRes.data.slice(0, 5)
      });
    } catch (error) {
      console.error('Error fetching stats:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="container-fluid my-5">
        <div className="text-center">
          <div className="spinner-border" role="status">
            <span className="visually-hidden">Loading...</span>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="container-fluid my-4">
      <div className="row">
        {/* Sidebar */}
        <div className="col-md-3 col-lg-2">
          <div className="card">
            <div className="card-header bg-primary text-white">
              <h6 className="mb-0">üõ†Ô∏è Qu·∫£n tr·ªã h·ªá th·ªëng</h6>
            </div>
            <div className="list-group list-group-flush">
              <Link to="/admin" className="list-group-item list-group-item-action active">
                üìä Dashboard
              </Link>
              <Link to="/admin/products" className="list-group-item list-group-item-action">
                üì¶ Qu·∫£n l√Ω s·∫£n ph·∫©m
              </Link>
              <Link to="/admin/orders" className="list-group-item list-group-item-action">
                üõí Qu·∫£n l√Ω ƒë∆°n h√†ng
              </Link>
              <Link to="/admin/categories" className="list-group-item list-group-item-action">
                üìÇ Qu·∫£n l√Ω danh m·ª•c
              </Link>
            </div>
          </div>
        </div>

        {/* Main Content */}
        <div className="col-md-9 col-lg-10">
          <h1 className="mb-4">üìä Dashboard Qu·∫£n tr·ªã</h1>
          
          {/* Stats Cards */}
          <div className="row mb-4">
            <div className="col-md-4">
              <div className="card bg-primary text-white">
                <div className="card-body">
                  <div className="d-flex justify-content-between">
                    <div>
                      <h5 className="card-title">T·ªïng s·∫£n ph·∫©m</h5>
                      <h2 className="mb-0">{stats.totalProducts}</h2>
                    </div>
                    <div className="align-self-center">
                      <i className="fas fa-box-open fa-2x"></i>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <div className="col-md-4">
              <div className="card bg-success text-white">
                <div className="card-body">
                  <div className="d-flex justify-content-between">
                    <div>
                      <h5 className="card-title">T·ªïng ƒë∆°n h√†ng</h5>
                      <h2 className="mb-0">{stats.totalOrders}</h2>
                    </div>
                    <div className="align-self-center">
                      <i className="fas fa-shopping-cart fa-2x"></i>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <div className="col-md-4">
              <div className="card bg-info text-white">
                <div className="card-body">
                  <div className="d-flex justify-content-between">
                    <div>
                      <h5 className="card-title">Ng∆∞·ªùi d√πng</h5>
                      <h2 className="mb-0">{stats.totalUsers}</h2>
                    </div>
                    <div className="align-self-center">
                      <i className="fas fa-users fa-2x"></i>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Recent Orders */}
          <div className="card">
            <div className="card-header">
              <h3 className="mb-0">üìã ƒê∆°n h√†ng g·∫ßn ƒë√¢y</h3>
            </div>
            <div className="card-body">
              {stats.recentOrders.length === 0 ? (
                <div className="alert alert-info">
                  Ch∆∞a c√≥ ƒë∆°n h√†ng n√†o.
                </div>
              ) : (
                <div className="table-responsive">
                  <table className="table table-striped">
                    <thead>
                      <tr>
                        <th>ID</th>
                        <th>Kh√°ch h√†ng</th>
                        <th>S·∫£n ph·∫©m</th>
                        <th>T·ªïng ti·ªÅn</th>
                        <th>Tr·∫°ng th√°i</th>
                        <th>Ng√†y ƒë·∫∑t</th>
                      </tr>
                    </thead>
                    <tbody>
                      {stats.recentOrders.map(order => (
                        <tr key={order.id}>
                          <td>#{order.id}</td>
                          <td>{order.user_name}</td>
                          <td>{order.items}</td>
                          <td>
                            {new Intl.NumberFormat('vi-VN', { 
                              style: 'currency', 
                              currency: 'VND' 
                            }).format(order.total_amount)}
                          </td>
                          <td>
                            <span className={`badge ${order.status === 'pending' ? 'bg-warning' : 'bg-success'}`}>
                              {order.status}
                            </span>
                          </td>
                          <td>
                            {new Date(order.created_at).toLocaleDateString('vi-VN')}
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
